import React from 'react';
import ReactDOM from 'react-dom/client';
import { Provider } from 'react-redux';
import App from './App';
// import './assets/scss/styles.modules.scss';
import './assets/scss/_/base.scss';
import './assets/scss/_/variables.scss';
import './assets/scss/_/mixins.scss';
import './assets/scss/_/animations.scss';
import './assets/scss/_/typography.scss';
import './assets/scss/_/buttons.scss';
import store from './modules/redux/store';

const rootNode: any = document.getElementById('root');

ReactDOM.createRoot(rootNode).render(
  <Provider store={store}>
    <App />
  </Provider>,
);
